import PropTypes from 'prop-types'
import Button from './Button'


const Header = ({title}) => {
    return (
        <header className='header'>
            <h1>{title}</h1>
            <Button color='green' text='Add'/>
        </header>
    )
}

Header.defaultProps = {
    title: "Task Tracker",
}

Button.defaultProps = {
    color: 'steelblue'
}

Button.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string,
}


// Make your own propType,
// with this, we can say, expect only strings
Header.propTypes = {
    title: PropTypes.string,
}



export default Header
